import { Component, Input } from '@angular/core';
import { Piece } from 'src/app/class/piece';

@Component({
    selector: 'app-piece',
    templateUrl: `./piece.component.html`,
    styleUrls: [`piece.component.css`]
})
export class PieceComponent {
    @Input()
    char!: string;
    pieceSymbol = ''
    ngOnInit() {
        this.pieceSymbol = new Piece().piecesList[this.char]
    }
